import React from 'react';
import Thumbnail from 'react-thumbnail';

function Dashboard() {
    return (
        <div className = "dashboard-container">
            <Thumbnail 
                width = {250}
                height = {250}
                page = "https://normaly0.github.io/"
                scale = {4} />      
        </div>
    )
}

export default Dashboard;
